import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';

@Component({
  selector: 'app-level2-game',
  templateUrl: './level2-game.component.html',
  styleUrls: ['./level2-game.component.css']
})
export class Level2GameComponent {
public word: string = '';
public word1: string='';
public word2: string='';

constructor(private route: ActivatedRoute , private router: Router) {}
ngOnInit() {
  this.route.queryParams.subscribe((params) => {
    this.word1 = params['data5'];
  });
  this.route.queryParams.subscribe((params) => {
    this.word2 = params['userName'];
    console.log(this.word2);
});
}

network(){
  this.router.navigate(["/level3"]);
}

cloud(){
  this.router.navigate(["/level3"]);
}

service(){
  this.router.navigate(["/level3"]);
}

socialMedia(){
  this.router.navigate(["/level3"]);

}
}
